 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "Gli esercizi Lista a discesa sono testi o frasi in cui gli studenti devono scegliere le parole corrette. Vengono spesso usati per i seguenti obiettivi:<\/p><ol><li>Controllare la conoscenza di concetti di base (pu\u00f2 essere un controllo preventivo, un esercizio o una verifica finale).<\/li><li>Verificare la comprensione del testo.<\/li><li>Verificare il lessico<\/li><li>Verificare la produzione e\/o la competenza grammaticale.<\/li><\/ol>", 
