 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Se l'obiettivo \u00e8 provare la conoscenza di concetti base o la comprensione del testo  <\/dt>  <dd>    <p>  Scrivere un sommario di concetti o un testo abbastanza lungo per testare gli obiettivi della conoscenza, ma non eccessivamente lungo da indurre pesantezza. Meno di una pagina scritta \u00e8 probabilmente abbastanza, ma probabilmente troppo per studenti giovani o per principianti.    <\/p>    <p>Evidenziare le parole del testo che sono parole chiavi per la conoscenza dei concetti. Questi dovrebbero essere probabilmente verbi, nomi e avverbi. Scegliere le alternative con una risposta non ambigua.    <\/p>  <\/dd>  <dt>Se l'obiettivo \u00e8 provare  la conoscenza lessicale  <\/dt>  <dd><p>Scrivere un testo usando le parole obiettivo del vocabolario. Questo testo dovrebbe essere coerente e conciso, e di adeguata lunghezza. Evidenziare le parole obiettivo nel testo. Scegliere le alternative con una risposta non ambigua.<\/p>  <\/dd>  <dt>Se l'obiettivo \u00e8 verificare la produzione scritta o la grammatica:  <\/dt>  <dd>  <p>Scrivere un testo usando le forme oggetto di verifica. Questo testo dovrebbe essere coerente, conciso e di adeguata lunghezza. Ricordare che se l'obiettivo non \u00e8 la conoscenza di un vocabolario, il significato delle parole chiave dovrebbe essere gi\u00e0\u00a0 noto agli studenti.  <\/p>  <p>Evidenziare le parole chiave nel testo. Fornire alternative con lo stesso insieme di parole, ma con differente struttura. \u00c8 una buona idea far provare il test ad un\/a collega per essere sicuri\/e che non ci saranno sorprese!  <\/p>  <\/dd><\/dl>", 
 "Enter the question stem. \nThe question should be clear and unambiguous. Avoid negative premises as these \ncan tend to confuse learners.": "Inserire una domanda. \nLa domanda dovrebbe essere chiara ed inequivocabile. Evitare premesse \nin forma negativa che tendono ad essere ambigue.", 
