 "Include Single Page export file?": "Includere file di esportazione in pagina singola?", 
 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>Gli insegnanti dovrebbero tenere a mente le seguenti informazioni quando usano questo iDevice: <\/p><ol><li>Pensare al numero di differenti tipi di attivit\u00e0 pianificate per le risorse che saranno segnalate in modo visuale nel contenuto. Non utilizzare un numero elevato di tipi o attivit\u00e0 di classificazione differenti altrimenti lo studente si potrebbe confondere. Normalmente tre o quattro tipi diversi sono pi\u00f9 che adeguati per la risorsa di insegnamento.<\/li><li>Da una prospettiva di progettazione visuale, evitare due iDevice consecutivi senza testo fra di essi. Se questo \u00e8 proprio necessario, riunire due domande o eventi in un solo iDevice. <\/li><li>Pensare alle attivit\u00e0 in modo tale che il beneficio percepito superi il tempo e lo sforzo che sar\u00e0 necessario per svolgerla. <\/li><\/ol>", 
