 "prove": "dimostrare", 
 "<p>If left unchecked a small number of spelling and capitalization errors will be accepted. If checked only an exact match in spelling and capitalization will be accepted.<\/p><p><strong>For example:<\/strong> If the correct answer is <code>Elephant<\/code> then both <code>elephant<\/code> and <code>Eliphant<\/code> will be judged <em>\"close enough\"<\/em> by the algorithm as it only has one letter wrong, even if \"Check Capitalization\" is on.<\/p><p>If capitalization checking is off in the above example, the lowercase <code>e<\/code> will not be considered a mistake and <code>eliphant<\/code> will also be accepted.<\/p><p>If both \"Strict Marking\" and \"Check Capitalization\" are set, the only correct answer is \"Elephant\". If only \"Strict Marking\" is checked and \"Check Capitalization\" is not, \"elephant\" will also be accepted.<\/p>": "<p>Se si lascia disabilitato saranno accettati solo un piccolo numero di errori ortografici o maiuscolo\/minuscolo. Se abilitato sar\u00e0 accettata l'esatta corrispondenza ortografica e di maiuscolo\/minuscolo.<\/p><p><strong>Per esempio:<\/strong> Se la risposta corretta \u00e8 <code>Elefante<\/code> quindi entrambe <code>elefante<\/code> e <code>Elifante<\/code> saranno giudicate <em>\"abbastanza vicino\"<\/em> dall'algoritmo anche se si ha una lettera errata, quando \"Verifica Maiuscolo\/Minuscolo\" \u00e8 abilitato.<\/p><p>Se la verifica Maiuscolo\/minuscolo \u00e8 disabilitata nell'esempio precedente, la lettera minuscola <code>e<\/code> non sar\u00e0\u00a0 considerata un errore e <code>elifante<\/code> sar\u00e0 anch'essa accettata.<\/p><p>Se entrambe \"Verifica stringente\" e \"Verifica Maiuscolo\/Minuscolo\" sono impostate, la sola risposta corretta \u00e8  \"Elefante\". Solo se \"Verifica stringente\" \u00e8 abilitata e \"Verifica Maiuscolo\/Minuscolo\" non lo \u00e8, \"elefante\" sar\u00e0 anche essa accettata.<\/p>", 
