 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Sebbene il pi\u00f9 delle volte utilizzate in situazione di verifica, \nle DRM possono essere utilizzate come mezzo \ndi stimolo del pensiero e di discussione su argomenti in cui gli studenti \nsono un po' reticenti nelle risposte. \n\nQuando si progetta un test con DRM bisogna considerare: \n<ul>\n<li> Quali aspettative di apprendimento verificano le domande<\/li>\n<li> Quali abilit\u00e0 intellettive esse verificano<\/li>\n<li> Quali sono le abilit\u00e0\u00a0linguistiche degli studenti<\/li>\n<li> Aspetti culturali e di genere<\/li>\n<li> Evitare strutture linguistiche e grammaticali che potrebbero \n     fornire indizi<\/li>\n<\/ul>\n ", 
