 "When building an MCQ consider the following: <ul>\n<li> Use phrases that learners are familiar with and have \nencountered in their study <\/li>\n<li> Keep responses concise <\/li>\n<li> There should be some consistency between the stem and the responses <\/li>\n<li> Provide enough options to challenge learners to think about their response\n<\/li>\n<li> Try to make sure that correct responses are not more detailed than the \ndistractors <\/li>\n<li> Distractors should be incorrect but plausible <\/li>\n<\/ul>\n": "Quando si costruisce una DRM considerare i seguenti suggerimenti: <ul>\n<li> Usare frasi che sono familiari agli studenti e che essi \nhanno gi\u00e0\u00a0incontrato nei loro studi <\/li>\n<li> Fornire risposte concise <\/li>\n<li> Creare una certa consistenza tra i punti e le risposte <\/li>\n<li> Fornire abbastanza opzioni per impegnare gli studenti a pensare alle loro risposte\n<\/li>\n<li> Assicurarsi che le risposte corrette non siano pi\u00f9 dettagliate dei distrattori <\/li>\n<li> I distrattori devono essere sbagliati ma plausibili <\/li>\n<\/ul>\n", 
